Free_text:
@Dad ‘S - "Mỹ ác hơn tàu chứ bạn ơi"
Tàu ác hơn Mỹ trăm lần chứ bạn ơi
- "có lẽ bạn kg biết lịch sử chính phủ Mỹ ...." Có lẽ bạn không biết lịch sử tàu luôn luôn muốn nuốt chửng nước Việt ta qua mộng bành trướng không ngơi nghỉ. - "nó gian tiếp kg trực tiếp như Trung Quốc ..."

